const nombre = 'Fernando';
const apellido = 'Alvez';


const nombreCompleto = `${ nombre } ${ apellido }`;


console.log(nombreCompleto);

function getSaludo(nombre) {
    return 'Hola mundo';
}


console.log(` Este es un texto: ${getSaludo()} `);
